/**
 * OpenPath - Strict Internet Access Control
 * Copyright (C) 2025 OpenPath Authors
 *
 * Tests for Schedule Storage and API
 */

import { describe, it, before, after, beforeEach } from 'node:test';
import assert from 'node:assert';
import { db } from '../src/db/index.js';
import { users, classrooms, schedules, machines, roles, tokens, pushSubscriptions } from '../src/db/schema.js';
import * as scheduleStorage from '../src/lib/schedule-storage.js';
import * as classroomStorage from '../src/lib/classroom-storage.js';
import { ClassroomService } from '../src/services/index.js';

// Test data
const testClassroomId = 'test-classroom-1';
const testTeacherId = 'teacher-1';
const testGroupId = 'group-math-3eso';

await describe('Schedule Storage', async () => {
    before(async () => {
        // Clean up database (respect FK constraints by deleting dependents first)
        await db.delete(tokens);
        await db.delete(pushSubscriptions);
        await db.delete(schedules);
        await db.delete(machines);
        await db.delete(roles);
        await db.delete(classrooms);
        await db.delete(users);

        // Create dependencies
        await db.insert(users).values({
            id: testTeacherId,
            email: 'teacher@test.com',
            name: 'Test Teacher',
            passwordHash: 'hash',
        });

        await db.insert(classrooms).values({
            id: testClassroomId,
            name: 'test-classroom',
            displayName: 'Test Classroom',
            defaultGroupId: 'default-group',
        });
    });

    beforeEach(async () => {
        await db.delete(schedules);
    });

    after(async () => {
        await db.delete(tokens);
        await db.delete(pushSubscriptions);
        await db.delete(schedules);
        await db.delete(machines);
        await db.delete(roles);
        await db.delete(classrooms);
        await db.delete(users);
    });

    await describe('Time Utilities', async () => {
        await it('should convert time string to minutes', () => {
            assert.strictEqual(scheduleStorage.timeToMinutes('00:00'), 0);
            assert.strictEqual(scheduleStorage.timeToMinutes('01:00'), 60);
            assert.strictEqual(scheduleStorage.timeToMinutes('08:30'), 510);
            assert.strictEqual(scheduleStorage.timeToMinutes('23:59'), 1439);
        });

        await it('should detect overlapping time ranges', () => {
            assert.strictEqual(scheduleStorage.timesOverlap('08:00', '09:00', '09:00', '10:00'), false);
            assert.strictEqual(scheduleStorage.timesOverlap('08:00', '09:00', '10:00', '11:00'), false);
            assert.strictEqual(scheduleStorage.timesOverlap('08:00', '09:00', '08:30', '09:30'), true);
            assert.strictEqual(scheduleStorage.timesOverlap('08:00', '10:00', '09:00', '09:30'), true);
            assert.strictEqual(scheduleStorage.timesOverlap('08:00', '09:00', '08:00', '09:00'), true);
        });
    });

    await describe('CRUD Operations', async () => {
        await it('should create a schedule', async () => {
            const schedule = await scheduleStorage.createSchedule({
                classroomId: testClassroomId,
                teacherId: testTeacherId,
                groupId: testGroupId,
                dayOfWeek: 1,
                startTime: '08:00',
                endTime: '09:00'
            });

            assert.ok(schedule.id !== '');
            assert.strictEqual(schedule.classroomId, testClassroomId);
            assert.strictEqual(schedule.teacherId, testTeacherId);
            assert.strictEqual(schedule.recurrence, 'weekly');
        });

        await it('should reject invalid day of week', async () => {
            await assert.rejects(async () => {
                await scheduleStorage.createSchedule({
                    classroomId: testClassroomId,
                    teacherId: testTeacherId,
                    groupId: testGroupId,
                    dayOfWeek: 6,
                    startTime: '08:00',
                    endTime: '09:00'
                });
            }, /dayOfWeek must be between 1.*and 5/);
        });

        await it('should reject invalid time format', async () => {
            await assert.rejects(async () => {
                await scheduleStorage.createSchedule({
                    classroomId: testClassroomId,
                    teacherId: testTeacherId,
                    groupId: testGroupId,
                    dayOfWeek: 1,
                    startTime: '8:00',
                    endTime: '09:00'
                });
            }, /Invalid time format/);
        });

        await it('should reject startTime >= endTime', async () => {
            await assert.rejects(async () => {
                await scheduleStorage.createSchedule({
                    classroomId: testClassroomId,
                    teacherId: testTeacherId,
                    groupId: testGroupId,
                    dayOfWeek: 1,
                    startTime: '09:00',
                    endTime: '08:00'
                });
            }, /startTime must be before endTime/);
        });

        await it('should detect conflicts', async () => {
            await scheduleStorage.createSchedule({
                classroomId: testClassroomId,
                teacherId: testTeacherId,
                groupId: testGroupId,
                dayOfWeek: 1,
                startTime: '08:00',
                endTime: '09:00'
            });

            await assert.rejects(async () => {
                await scheduleStorage.createSchedule({
                    classroomId: testClassroomId,
                    teacherId: testTeacherId, // Reusing same teacher/classroom for conflict
                    groupId: 'group-other',
                    dayOfWeek: 1,
                    startTime: '08:30',
                    endTime: '09:30'
                });
            }, /Schedule conflict/);
        });

        await it('should allow non-overlapping schedules', async () => {
            await scheduleStorage.createSchedule({
                classroomId: testClassroomId,
                teacherId: testTeacherId,
                groupId: testGroupId,
                dayOfWeek: 1,
                startTime: '08:00',
                endTime: '09:00'
            });

            const schedule2 = await scheduleStorage.createSchedule({
                classroomId: testClassroomId,
                teacherId: testTeacherId,
                groupId: 'group-other',
                dayOfWeek: 1,
                startTime: '09:00',
                endTime: '10:00'
            });

            assert.ok(schedule2.id !== '');
        });

        await it('should update a schedule', async () => {
            const schedule = await scheduleStorage.createSchedule({
                classroomId: testClassroomId,
                teacherId: testTeacherId,
                groupId: testGroupId,
                dayOfWeek: 1,
                startTime: '08:00',
                endTime: '09:00'
            });

            const updated = await scheduleStorage.updateSchedule(schedule.id, {
                startTime: '08:30',
                endTime: '09:30'
            });

            assert.ok(updated);
            assert.strictEqual(updated.startTime, '08:30:00'); // DB might return seconds
            assert.strictEqual(updated.endTime, '09:30:00');
        });

        await it('should delete a schedule', async () => {
            const schedule = await scheduleStorage.createSchedule({
                classroomId: testClassroomId,
                teacherId: testTeacherId,
                groupId: testGroupId,
                dayOfWeek: 1,
                startTime: '08:00',
                endTime: '09:00'
            });

            const deleted = await scheduleStorage.deleteSchedule(schedule.id);
            assert.strictEqual(deleted, true);

            const retrieved = await scheduleStorage.getScheduleById(schedule.id);
            assert.strictEqual(retrieved, null);
        });
    });

    await describe('Query Operations', async () => {
        beforeEach(async () => {
            await scheduleStorage.createSchedule({
                classroomId: testClassroomId,
                teacherId: testTeacherId,
                groupId: testGroupId,
                dayOfWeek: 1,
                startTime: '08:00',
                endTime: '09:00'
            });
            await scheduleStorage.createSchedule({
                classroomId: testClassroomId,
                teacherId: testTeacherId,
                groupId: 'group-other',
                dayOfWeek: 1,
                startTime: '09:00',
                endTime: '10:00'
            });
        });

        await it('should get schedules by classroom', async () => {
            const schedules = await scheduleStorage.getSchedulesByClassroom(testClassroomId);
            assert.strictEqual(schedules.length, 2);
        });

        await it('should get schedules by teacher', async () => {
            const schedules = await scheduleStorage.getSchedulesByTeacher(testTeacherId);
            assert.strictEqual(schedules.length, 2); // Both created with same teacher
            const firstSchedule = schedules[0];
            if (!firstSchedule) throw new Error('No schedule found');
            assert.strictEqual(firstSchedule.teacherId, testTeacherId);
        });
    });

    await describe('getCurrentSchedule', async () => {
        beforeEach(async () => {
            await db.delete(schedules);
        });

        await it('should return null on weekends', async () => {
            await scheduleStorage.createSchedule({
                classroomId: testClassroomId,
                teacherId: testTeacherId,
                groupId: testGroupId,
                dayOfWeek: 1,
                startTime: '08:00',
                endTime: '09:00'
            });

            const sunday = new Date('2025-01-05T09:00:00');
            const result = await scheduleStorage.getCurrentSchedule(testClassroomId, sunday);
            assert.strictEqual(result, null);
        });

        await it('should return correct schedule for current time', async () => {
            await scheduleStorage.createSchedule({
                classroomId: testClassroomId,
                teacherId: testTeacherId,
                groupId: testGroupId,
                dayOfWeek: 3,
                startTime: '08:00',
                endTime: '09:00'
            });

            const wednesday = new Date('2025-01-08T08:30:00'); // Wed Jan 08 2025
            const result = await scheduleStorage.getCurrentSchedule(testClassroomId, wednesday);

            assert.ok(result !== null);
            assert.strictEqual(result.groupId, testGroupId);
        });

        await it('should return null outside scheduled times', async () => {
            await scheduleStorage.createSchedule({
                classroomId: testClassroomId,
                teacherId: testTeacherId,
                groupId: testGroupId,
                dayOfWeek: 3,
                startTime: '08:00',
                endTime: '09:00'
            });

            const wednesday = new Date('2025-01-08T10:00:00');
            const result = await scheduleStorage.getCurrentSchedule(testClassroomId, wednesday);
            assert.strictEqual(result, null);
        });
    });

    await describe('Whitelist Integration', async () => {
        beforeEach(async () => {
            await db.delete(schedules);
            await db.delete(machines);
            // Don't delete classrooms/users to keep dependencies valid
            // But we need to make sure we don't conflict on names if we recreate

            // For whitelist tests we'll use unique names in the tests themselves
        });

        await it('should use schedule group when no manual override', async () => {
            // Setup specialized classroom
            const classroomName = 'aula-test-whitelist';
            // Cleanup previous if exists
            const existing = await classroomStorage.getClassroomByName(classroomName);
            if (existing) await classroomStorage.deleteClassroom(existing.id);

            const classroom = await classroomStorage.createClassroom({
                name: classroomName,
                displayName: 'Aula Test',
                defaultGroupId: 'default-group'
            });

            await classroomStorage.registerMachine({
                hostname: 'pc-test-01',
                classroomId: classroom.id
            });

            const now = new Date();
            const dayOfWeek = now.getDay();

            // Setup valid schedule for NOW
            if (dayOfWeek !== 0 && dayOfWeek !== 6) {
                const currentHour = now.getHours();
                // Ensure valid HH:MM format
                const startTime = `${String(currentHour).padStart(2, '0')}:00`;
                const endTime = `${String(currentHour + 1).padStart(2, '0')}:00`;

                // Conflict check? Logic assumes none

                await scheduleStorage.createSchedule({
                    classroomId: classroom.id,
                    teacherId: testTeacherId,
                    groupId: 'scheduled-group',
                    dayOfWeek: dayOfWeek,
                    startTime: startTime,
                    endTime: endTime
                });

                const result = await ClassroomService.getWhitelistUrl('pc-test-01');

                assert.ok(result.ok);
                assert.strictEqual(result.data.groupId, 'scheduled-group');
                assert.strictEqual(result.data.source, 'schedule');
            } else {
                console.log('Skipping schedule test on weekend');
            }
        });

        await it('should prefer manual override over schedule', async () => {
            const classroomName = 'aula-override';
            const existing = await classroomStorage.getClassroomByName(classroomName);
            if (existing) await classroomStorage.deleteClassroom(existing.id);

            const classroom = await classroomStorage.createClassroom({
                name: classroomName,
                displayName: 'Aula Override',
                defaultGroupId: 'default-group'
            });

            await classroomStorage.setActiveGroup(classroom.id, 'manual-group');

            await classroomStorage.registerMachine({
                hostname: 'pc-override-01',
                classroomId: classroom.id
            });

            const result = await ClassroomService.getWhitelistUrl('pc-override-01');

            assert.ok(result.ok);
            assert.strictEqual(result.data.groupId, 'manual-group');
            assert.strictEqual(result.data.source, 'manual');
        });

        await it('should fall back to default group when no schedule', async () => {
            const classroomName = 'aula-default';
            const existing = await classroomStorage.getClassroomByName(classroomName);
            if (existing) await classroomStorage.deleteClassroom(existing.id);

            const classroom = await classroomStorage.createClassroom({
                name: classroomName,
                displayName: 'Aula Default',
                defaultGroupId: 'fallback-group'
            });

            await classroomStorage.registerMachine({
                hostname: 'pc-default-01',
                classroomId: classroom.id
            });

            const result = await ClassroomService.getWhitelistUrl('pc-default-01');

            assert.ok(result.ok);
            assert.strictEqual(result.data.groupId, 'fallback-group');
            assert.strictEqual(result.data.source, 'default');
        });
    });
});

/**
 * OpenPath - Service Layer Barrel Export
 */

import SetupService from './setup.service.js';
import ClassroomService from './classroom.service.js';
import RequestService from './request.service.js';
import AuthService from './auth.service.js';
import ScheduleService from './schedule.service.js';
import UserService from './user.service.js';

export {
    SetupService,
    ClassroomService,
    RequestService,
    AuthService,
    ScheduleService,
    UserService
};

/**
 * OpenPath - Strict Internet Access Control
 * Copyright (C) 2025 OpenPath Authors
 *
 * Classroom Storage - PostgreSQL-based classroom and machine management using Drizzle ORM
 */

import { v4 as uuidv4 } from 'uuid';
import { eq, sql, count } from 'drizzle-orm';
import { db, classrooms, machines } from '../db/index.js';
import { logger } from './logger.js';
import type { Classroom, MachineStatus } from '../types/index.js';
import type { IClassroomStorage, CreateClassroomData, UpdateClassroomData } from '../types/storage.js';

// =============================================================================
// Types
// =============================================================================

type DBClassroom = typeof classrooms.$inferSelect;
type DBMachine = typeof machines.$inferSelect;

interface ClassroomWithCount {
    id: string;
    name: string;
    displayName: string;
    defaultGroupId: string | null;
    activeGroupId: string | null;
    createdAt: Date;
    updatedAt: Date;
    machineCount: number;
}

export interface WhitelistUrlResult {
    groupId: string;
    classroomId: string;
    classroomName: string;
}

export interface ClassroomStats {
    classrooms: number;
    machines: number;
    classroomsWithActiveGroup: number;
}

// =============================================================================
// Helper Functions
// =============================================================================

function toClassroomType(classroom: DBClassroom, machineList: DBMachine[] = []): Classroom {
    return {
        id: classroom.id,
        name: classroom.name,
        displayName: classroom.displayName,
        machines: machineList.map((m) => ({
            id: m.id,
            hostname: m.hostname,
            classroomId: m.classroomId,
            version: m.version ?? undefined,
            lastSeen: m.lastSeen?.toISOString() ?? null,
            status: 'unknown' as MachineStatus
        })),
        createdAt: classroom.createdAt?.toISOString() ?? new Date().toISOString(),
        updatedAt: classroom.updatedAt?.toISOString() ?? new Date().toISOString(),
        defaultGroupId: classroom.defaultGroupId,
        activeGroupId: classroom.activeGroupId
    };
}

// =============================================================================
// Classroom CRUD
// =============================================================================

/**
 * Get all classrooms with their machine counts.
 * 
 * @returns Promise resolving to array of classrooms with counts
 */
export async function getAllClassrooms(): Promise<ClassroomWithCount[]> {
    const result = await db.select({
        id: classrooms.id,
        name: classrooms.name,
        displayName: classrooms.displayName,
        defaultGroupId: classrooms.defaultGroupId,
        activeGroupId: classrooms.activeGroupId,
        createdAt: classrooms.createdAt,
        updatedAt: classrooms.updatedAt,
        machineCount: sql<number>`COUNT(${machines.id})::int`.as('machineCount'),
    })
        .from(classrooms)
        .leftJoin(machines, eq(machines.classroomId, classrooms.id))
        .groupBy(classrooms.id)
        .orderBy(sql`${classrooms.createdAt} DESC`);

    return result.map((row) => ({
        id: row.id,
        name: row.name,
        displayName: row.displayName,
        defaultGroupId: row.defaultGroupId,
        activeGroupId: row.activeGroupId,
        createdAt: row.createdAt ?? new Date(),
        updatedAt: row.updatedAt ?? new Date(),
        machineCount: row.machineCount,
    }));
}

export async function getClassroomById(id: string): Promise<DBClassroom | null> {
    const result = await db.select()
        .from(classrooms)
        .where(eq(classrooms.id, id))
        .limit(1);

    return result[0] ?? null;
}

export async function getClassroomByName(name: string): Promise<DBClassroom | null> {
    const result = await db.select()
        .from(classrooms)
        .where(sql`LOWER(${classrooms.name}) = LOWER(${name})`)
        .limit(1);

    return result[0] ?? null;
}

/**
 * Create a new classroom.
 * Generates a URL-safe name (slug) from the provided name.
 * 
 * @param classroomData - Data for the new classroom
 * @returns Promise resolving to the created classroom record
 * @throws {Error} If a classroom with the same generated slug already exists
 */
export async function createClassroom(
    classroomData: CreateClassroomData & { defaultGroupId?: string }
): Promise<DBClassroom> {
    const { name, displayName, defaultGroupId } = classroomData;
    const slug = name.toLowerCase().replace(/\s+/g, '-').replace(/[^a-z0-9-]/g, '');

    // Check if exists
    const existing = await getClassroomByName(slug);
    if (existing) {
        throw new Error(`Classroom with name "${slug}" already exists`);
    }

    const id = `room_${uuidv4().slice(0, 8)}`;

    const [result] = await db.insert(classrooms)
        .values({
            id,
            name: slug,
            displayName: displayName ?? name,
            defaultGroupId: defaultGroupId ?? null,
        })
        .returning();

    if (!result) {
        throw new Error(`Failed to create classroom "${slug}"`);
    }
    return result;
}

export async function updateClassroom(
    id: string,
    updates: UpdateClassroomData & { defaultGroupId?: string }
): Promise<DBClassroom | null> {
    const updateValues: Partial<typeof classrooms.$inferInsert> = {};

    if (updates.displayName !== undefined) {
        updateValues.displayName = updates.displayName;
    }
    if (updates.defaultGroupId !== undefined) {
        updateValues.defaultGroupId = updates.defaultGroupId;
    }

    if (Object.keys(updateValues).length === 0) {
        return getClassroomById(id);
    }

    const [result] = await db.update(classrooms)
        .set(updateValues)
        .where(eq(classrooms.id, id))
        .returning();

    return result ?? null;
}

export async function setActiveGroup(id: string, groupId: string | null): Promise<DBClassroom | null> {
    const [result] = await db.update(classrooms)
        .set({ activeGroupId: groupId })
        .where(eq(classrooms.id, id))
        .returning();

    return result ?? null;
}

export async function getCurrentGroupId(id: string): Promise<string | null> {
    const classroom = await getClassroomById(id);
    if (!classroom) return null;
    return classroom.activeGroupId ?? classroom.defaultGroupId;
}

export async function deleteClassroom(id: string): Promise<boolean> {
    const result = await db.delete(classrooms)
        .where(eq(classrooms.id, id));

    return (result.rowCount ?? 0) > 0;
}

// =============================================================================
// Machine CRUD
// =============================================================================

export async function getAllMachines(): Promise<DBMachine[]> {
    const result = await db.select()
        .from(machines)
        .orderBy(sql`${machines.createdAt} DESC`);

    return result;
}

export async function getMachinesByClassroom(classroomId: string): Promise<DBMachine[]> {
    const result = await db.select()
        .from(machines)
        .where(eq(machines.classroomId, classroomId));

    return result;
}

export async function getMachineByHostname(hostname: string): Promise<DBMachine | null> {
    const result = await db.select()
        .from(machines)
        .where(sql`LOWER(${machines.hostname}) = LOWER(${hostname})`)
        .limit(1);

    return result[0] ?? null;
}

/**
 * Register a machine to a classroom.
 * If the machine already exists, it is updated (moved to new classroom).
 * 
 * @param machineData - Machine registration data
 * @returns Promise resolving to the machine record
 */
export async function registerMachine(machineData: {
    hostname: string;
    classroomId: string;
    version?: string;
}): Promise<DBMachine> {
    const { hostname, classroomId, version } = machineData;
    const normalizedHostname = hostname.toLowerCase();

    // Check if machine already exists
    const existing = await getMachineByHostname(normalizedHostname);
    if (existing) {
        // Update existing machine
        const [result] = await db.update(machines)
            .set({
                classroomId,
                version: version ?? existing.version,
                lastSeen: new Date(),
            })
            .where(eq(machines.id, existing.id))
            .returning();

        if (!result) {
            throw new Error(`Failed to update machine "${hostname}"`);
        }
        return result;
    }

    // Create new machine
    const id = `machine_${uuidv4().slice(0, 8)}`;
    const [result] = await db.insert(machines)
        .values({
            id,
            hostname: normalizedHostname,
            classroomId,
            version: version ?? 'unknown',
        })
        .returning();

    if (!result) {
        throw new Error('Failed to register machine');
    }

    return result;
}

export async function updateMachineLastSeen(hostname: string): Promise<DBMachine | null> {
    const machine = await getMachineByHostname(hostname);
    if (!machine) return null;

    const [result] = await db.update(machines)
        .set({ lastSeen: new Date() })
        .where(eq(machines.id, machine.id))
        .returning();

    return result ?? null;
}

/**
 * Get the machine record by hostname
 */
export async function getMachineOnlyByHostname(hostname: string): Promise<DBMachine | null> {
    const result = await db.select()
        .from(machines)
        .where(sql`LOWER(${machines.hostname}) = LOWER(${hostname})`)
        .limit(1);

    return result[0] ?? null;
}

export async function deleteMachine(hostname: string): Promise<boolean> {
    const machine = await getMachineByHostname(hostname);
    if (!machine) return false;

    const result = await db.delete(machines)
        .where(eq(machines.id, machine.id));

    return (result.rowCount ?? 0) > 0;
}

export async function removeMachinesByClassroom(classroomId: string): Promise<number> {
    const result = await db.delete(machines)
        .where(eq(machines.classroomId, classroomId));

    return result.rowCount ?? 0;
}

/**
 * Get the correct whitelist URL for a machine based on its classroom state.
 * Priority:
 * 1. Active override group (if set by teacher)
 * 2. Scheduled class group (if current time matches a schedule)
 * 3. Default classroom group
 * 
 * @param hostname - Machine hostname
 * @returns Promise resolving to whitelist result or null if machine/classroom not found
 */
export async function getWhitelistUrlForMachine(hostname: string): Promise<WhitelistUrlResult | null> {
    const machine = await getMachineByHostname(hostname);
    if (!machine) return null;

    const classroomId = machine.classroomId;
    if (!classroomId) return null;

    const classroom = await getClassroomById(classroomId);
    if (!classroom) return null;

    let groupId = classroom.activeGroupId;
    if (groupId === null) {
        // Try to get from schedule
        try {
            const { getCurrentSchedule } = await import('./schedule-storage.js');
            const currentSchedule = await getCurrentSchedule(classroom.id);
            if (currentSchedule) {
                groupId = currentSchedule.groupId;
            }
        } catch {
            // Schedule storage not available
        }
    }

    groupId ??= classroom.defaultGroupId;

    if (groupId === null) return null;

    return {
        groupId,
        classroomId: classroom.id,
        classroomName: classroom.name,
    };
}

export async function getStats(): Promise<ClassroomStats> {
    const classroomResult = await db.select({
        total: count(),
        active: sql<number>`COUNT(*) FILTER (WHERE ${classrooms.activeGroupId} IS NOT NULL)`.as('active'),
    })
        .from(classrooms);

    const machineResult = await db.select({
        total: count(),
    })
        .from(machines);

    return {
        classrooms: classroomResult[0]?.total ?? 0,
        machines: machineResult[0]?.total ?? 0,
        classroomsWithActiveGroup: classroomResult[0]?.active ?? 0
    };
}

// =============================================================================
// Storage Instance
// =============================================================================

export const classroomStorage: IClassroomStorage = {
    getAllClassrooms: async () => {
        const allClassrooms = await getAllClassrooms();
        const result: Classroom[] = [];

        for (const c of allClassrooms) {
            const machineList = await getMachinesByClassroom(c.id);
            const classroom = toClassroomType({
                id: c.id,
                name: c.name,
                displayName: c.displayName,
                defaultGroupId: c.defaultGroupId,
                activeGroupId: c.activeGroupId,
                createdAt: c.createdAt,
                updatedAt: c.updatedAt
            } as DBClassroom, machineList);
            classroom.machineCount = c.machineCount;
            result.push(classroom);
        }

        return result;
    },
    getClassroomById: async (id: string) => {
        const classroom = await getClassroomById(id);
        if (!classroom) return null;
        const machineList = await getMachinesByClassroom(id);
        return toClassroomType(classroom, machineList);
    },
    getClassroomByName: async (name: string) => {
        const classroom = await getClassroomByName(name);
        if (!classroom) return null;
        const machineList = await getMachinesByClassroom(classroom.id);
        return toClassroomType(classroom, machineList);
    },
    createClassroom: async (data: CreateClassroomData) => {
        const classroom = await createClassroom(data);
        return toClassroomType(classroom);
    },
    updateClassroom: async (id: string, data: UpdateClassroomData) => {
        const classroom = await updateClassroom(id, data);
        if (!classroom) return null;
        const machineList = await getMachinesByClassroom(id);
        return toClassroomType(classroom, machineList);
    },
    deleteClassroom,
    addMachine: async (classroomId: string, hostname: string) => {
        const machine = await registerMachine({ hostname, classroomId });
        return {
            id: machine.id,
            hostname: machine.hostname,
            classroomId: machine.classroomId,
            version: machine.version ?? undefined,
            lastSeen: machine.lastSeen?.toISOString() ?? null,
            status: 'unknown' as MachineStatus
        };
    },
    removeMachine: async (classroomId: string, hostname: string) => {
        const machine = await getMachineByHostname(hostname);
        if (machine?.classroomId !== classroomId) return false;
        return deleteMachine(hostname);
    },
    getMachineByHostname: async (hostname: string) => {
        const machine = await getMachineByHostname(hostname);
        if (!machine?.classroomId) return null;
        const classroom = await getClassroomById(machine.classroomId);
        if (!classroom) return null;
        return {
            classroom: toClassroomType(classroom),
            machine: {
                id: machine.id,
                hostname: machine.hostname,
                classroomId: machine.classroomId,
                version: machine.version ?? undefined,
                lastSeen: machine.lastSeen?.toISOString() ?? null,
                status: 'unknown' as MachineStatus
            }
        };
    },
    updateMachineStatus: async (hostname: string, _status: 'online' | 'offline') => {
        const machine = await updateMachineLastSeen(hostname);
        return machine !== null;
    }
};

